def lucas_sequence(n):
    primes = [3, 3]

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    for i in range(4, n + 1):
        if is_prime(i):
            primes.append(i)
    memo = {}

    def lucas(num):
        if num == 0:
            return primes[0]
        if num == 1:
            return primes[1]
        if num in memo:
            return memo[num]
        else:
            memo[num] = lucas(num - 1) + lucas(num - 2)
            return memo[num]
    lucas_seq = []
    for i in range(n):
        lucas_seq.append(lucas(i))
    return lucas_seq

